package com.example.android;

import java.util.ArrayList;
import java.util.Base64;
import java.util.List;

public class Graph {
    private int[][] adjacencyMatrix;
    private int numberOfNodes;
    private List<Integer>[] adjacencyList;
    private boolean visited[];

    public Graph(int numberOfNodes) {
        this.numberOfNodes = numberOfNodes;
        this.adjacencyMatrix = new int[numberOfNodes][numberOfNodes];

        for (int i = 0; i < numberOfNodes; i++) {
            for (int j = 0; j < numberOfNodes; j++) {
                this.adjacencyMatrix[i][j] = 0;
            }
        }
    }

    public boolean hasEdge(int i, int j) {
        if (i < 0 || i >= numberOfNodes || j < 0 || j >= numberOfNodes)
            return false;
        return adjacencyMatrix[i][j] != 0;
    }

    public int getEdge(int i, int j) {
        return adjacencyMatrix[i][j];
    }

    // Method to print the adjacency matrix
    public void printAdjacencyMatrix() {
        for (int i = 0; i < numberOfNodes; i++) {
            for (int j = 0; j < numberOfNodes; j++) {
                System.out.print(adjacencyMatrix[i][j] + " ");
            }
            System.out.println();
        }
    }

    private void loadGraph(String base64Graph) {
        String decoded = null;
        if (android.os.Build.VERSION.SDK_INT >= android.os.Build.VERSION_CODES.O) {
            decoded = new String(Base64.getDecoder().decode(base64Graph));
        }
        String[] edges = decoded.split(";");
        for (String edge : edges) {
            String[] parts = edge.split(",");
            int u = Integer.parseInt(parts[0]);
            int v = Integer.parseInt(parts[1]);
            int weight = Integer.parseInt(parts[2]);
            adjacencyMatrix[u][v] = weight;
            adjacencyMatrix[v][u] = weight;
        }
    }

    private void dfs(int node) {
        visited[node] = true;
        for (int i : adjacencyList[node]) {
            if (!visited[i]) {
                dfs(i);
            }
        }
    }

    public boolean checkConnectivity(List<Pair> pairs) {
        visited = new boolean[1000];
        adjacencyList = new ArrayList[1000];

        for (int i = 0; i < 1000; i++) {
            adjacencyList[i] = new ArrayList<>();
            visited[i] = false;
        }

        for (Pair p : pairs) {
            adjacencyList[p.first].add(p.second);
            adjacencyList[p.second].add(p.first);
        }

        dfs(576);
        for (int i = 0; i < 1000; i++) {
            if (!visited[i]) {
                return false;
            }
        }

        return true;
    }

    public void load() {
        loadGraph(
                "");
    }
}
